import React from "react";

const Footer = () => {
  return (
    <div
      className="ui inverted vertical footer segment"
      style={{ bottom: "0" }}
    >
      <div class="ui container segment inverted">Kelvin Ian Manalo 2021</div>
    </div>
  );
};

export default Footer;
